import{_ as e,o as t,c as a,b as r,d as o,e as s,a as l,r as i}from"./app.399c4537.js";const n=JSON.parse('{"title":"Git工具","description":"","frontmatter":{},"headers":[{"level":2,"title":"Windows","slug":"windows","link":"#windows","children":[]},{"level":2,"title":"MacOSX","slug":"macosx","link":"#macosx","children":[]},{"level":2,"title":"问题排查","slug":"trouble-shooting","link":"#trouble-shooting","children":[]},{"level":2,"title":"其他工具","slug":"other-tools","link":"#other-tools","children":[]},{"level":2,"title":"使用","slug":"usage","link":"#usage","children":[]}],"relativePath":"git/01-git-install.md","lastUpdated":1663313048000}'),c={name:"git/01-git-install.md"},h=o("h1",{id:"git工具",tabindex:"-1"},[s("Git工具 "),o("a",{class:"header-anchor",href:"#git工具","aria-hidden":"true"},"#")],-1),d=l('<blockquote><p>如果您的电脑已安装Git命令行工具，请跳过本章。</p></blockquote><h2 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-hidden="true">#</a></h2><p>Windows需要电脑本机安装git-bash，<a href="https://git-scm.com/download/win" target="_blank" rel="noreferrer">Git Bash下载地址</a></p><blockquote><p>如果上面的地址，无法访问，请用迅雷直接使用下面的地址进行下载：</p></blockquote><p>windows git安装包，是一个exe文件，双击打开，不停的【下一步】即可完成安装。</p><p><a href="https://github.com/git-for-windows/git/releases" target="_blank" rel="noreferrer">git下载地址</a></p><h2 id="macosx" tabindex="-1">MacOSX <a class="header-anchor" href="#macosx" aria-hidden="true">#</a></h2><blockquote><p>MacOSX 部分机型自带git工具，如果没有，可以通过<a href="https://brew.sh/index_zh-cn" target="_blank" rel="noreferrer">brew</a>安装git命令工具</p></blockquote><p>安装命令：</p><div class="language-bash"><button class="copy"></button><span class="lang">bash</span><pre><code><span class="line"><span style="color:#A6ACCD;">/bin/bash -c </span><span style="color:#89DDFF;">&quot;$(</span><span style="color:#C3E88D;">curl -fsSL https://raw.githubusercontent.com/Homebrew/install/HEAD/install.sh</span><span style="color:#89DDFF;">)&quot;</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#A6ACCD;">brew install git</span></span>\n<span class="line"></span></code></pre></div><p>如果brew因网络问题安装失败，请参考：<a href="https://www.jianshu.com/p/06a9a59e7040" target="_blank" rel="noreferrer">详情</a></p><h2 id="trouble-shooting" tabindex="-1">问题排查 <a class="header-anchor" href="#trouble-shooting" aria-hidden="true">#</a></h2><p>打开<code>操作系统终端命令行</code>软件，输入<code>git --version</code>, 检查下命令是否存在。</p><p>如果终端出现下列错误，则说明git<code>没有</code>安装成功。</p><ul><li>错误1： <code>&#39;git&#39; 不是内部或外部命令，也不是可运行的程序或批处理文件。</code></li><li>错误2：<code>git: command not found</code></li></ul><blockquote><p>特别注意：windows电脑，如果您确定已成功安装Git安装包，但是命令行还是出现上面的错误，请将git安装目录加入到系统环境变量。</p></blockquote><h2 id="other-tools" tabindex="-1">其他工具 <a class="header-anchor" href="#other-tools" aria-hidden="true">#</a></h2><ul><li><a href="https://git-scm.com/" target="_blank" rel="noreferrer">Git 官网</a></li><li><a href="https://www.jianshu.com/p/3c480961210f?from=timeline" target="_blank" rel="noreferrer">vscode 中使用 git</a></li><li><a href="https://www.sourcetreeapp.com/" target="_blank" rel="noreferrer">sourctree</a> 可以选择内置 git</li><li><a href="https://tortoisegit.org/" target="_blank" rel="noreferrer">TortoiseGit</a> <a href="https://www.cnblogs.com/xiuxingzhe/p/9312929.html" target="_blank" rel="noreferrer">参考</a></li></ul><h2 id="usage" tabindex="-1">使用 <a class="header-anchor" href="#usage" aria-hidden="true">#</a></h2><blockquote><p>使用 <a href="https://git-scm.com/" target="_blank" rel="noreferrer">Git</a> 作为版本管理工具，代码则托管在内网的 <code>gitLab</code> 中：</p></blockquote>',20);const p=e(c,[["render",function(e,o,s,l,n,c){const p=i("VueJobs");return t(),a("div",null,[h,r(p),d])}]]);export{n as __pageData,p as default};
